INSERT INTO `code_bank` (`ID`, `cID`, `code`, `dName`, `dDescription`, `oID`, `iV`, `iX`) VALUES
(1, 1, 'L', 'Lecturing', 'The instructor is talking to the students and not using visuals, demonstration equipment, or actively writing.', 1, 1, 0),
(2, 1, 'LW', 'Lecturing While Writing', 'The instructor is talking to the students while actively writing on a chalkboard, transparencies, digital tablet, or other material. The instructor must either be writing or referring to what they are writing (or have already written). This code also captures real-time drawing of graphics (e.g., molecular structure, physiological processes), and if the use of visual representations is of interest, this should be included in the notes section. (Note that this code also captures writing/drawing in front of students without speaking, as a separate code for silent writing was deemed superfluous).', 2, 1, 0),
(3, 1, 'LVIS', 'Lecturing from Pre-Made Visuals', 'The instructor is talking to the students while referencing visual aides, such as slides, transparencies, posters, or models (e.g., plastic model of molecular structure, examples of sedimentary rocks, multi-media). The instructor must be referring to the topic contained in the visual, but the visual serves only as a reference point for the material and not as a live demonstration of phenomenon.', 3, 1, 0),
(4, 1, 'LDEM', 'Lecturing with Demonstration', 'The instructor actively uses equipment (e.g., lab equipment, computer simulation) to convey course content. The objects must be in active use in relation to the topic and must be used for more than a simple reference point (e.g., "here is an example of a sedimentary rock") to demonstrate a process or phenomenon in class (e.g., "here is how sedimentary rock erodes over time" while physically demonstrating this process).', 4, 1, 0),
(5, 1, 'CQ', 'Clicker Question', 'The instructor is explicitly gathering student learning data in class using a clicker question. ', 7, 1, 0),
(6, 1, 'AT', 'Administrative Task', 'The instructor is discussing exams, homework, or other non-content related topics.', 6, 1, 1),
(7, 2, 'SGW', 'Small Group Work', 'Students form into groups of 2+ to work on worksheet activity', 1, 1, 0),
(8, 2, 'SP', 'Student Presentation', 'Groups or individual students are giving to the class or are otherwise acting as the primary speaker or instructor in the classroom. In this instance, only select this code and none others as long as the primary instructor is not actively taking the lead in teaching the class.', 3, 1, 0),
(9, 2, 'DW', 'Deskwork', 'Students complete work alone at their desk/chair.', 4, 1, 0),
(10, 1, 'ID', 'Idle', 'An unique or unforeseen occurrences when the activity of the class becomes idle. Can also be used when instructors provide breaks during the class. ', 9, 1, 0),
(11, 2, 'GD', 'Group Discussion', 'Students form into groups of 2+ to discuss clicker question', 2, 1, 0),
(12, 3, 'IRQ', 'Rhetorical Question', 'The instructor asks a question without seeking an answer and without giving students an opportunity to answer the question.', 2, 1, 0),
(13, 3, 'IDQ', 'Display Question', 'The instructor poses a question seeking information. These questions can: seek a specific fact, a solution to a closed-ended problem, or involve students generating their own ideas rather than finding a specific solution.', 1, 1, 0),
(14, 3, 'ICQ', 'Comprehension Question', 'The instructor checks for understanding (e.g., "Does that make sense?") and pauses for at least five seconds, thereby indicating an opportunity for students to respond.', 3, 1, 0),
(15, 4, 'SQ', 'Display Question', 'A student poses a question to the instructor that seeks new information (i.e. not asking to clarify a concept that was previously being discussed) and/or clarification of a concept that is part of the current or past class period.', 1, 1, 0),
(16, 4, 'SR', 'Response to Instructor', 'A student responds to a question posed by the instructor, whether posed verbally by the instructor or through digital means (e.g., clicker, website).', 2, 1, 0),
(17, 4, 'WC', 'Response to Student', 'Student is engaged in whole class discussion and offers explanation, opinion, judgement to class.', 3, 1, 0),
(18, 4, 'PrD', 'Makes Prediction', 'A student makes a prediction about the outcome of a demo or experiment.', 4, 1, 0),
(19, 3, 'FUp', 'Provides Feedback', 'The instructor follows-up, or provides feedback, on a clicker question or activity to the entire class.', 4, 1, 0),
(20, 1, 'IL', 'Interactive Lecture', 'The instructor is talking to the students while asking multiple, successive questions to which the students are responding. Student responses are either guiding or being integrated within the discussion. A minimum of 2 relevant student responses is required to use this code.', 5, 0, 0),
(21, 5, 'WP', 'Working Out Problems', 'This code refers to the instructor working out computations or problems. These can include balancing a chemical equation, working out a mathematical proof, or designing equations or Punnett squares, etc. The intent of the code is to capture the working through of some sort of problems in front of students.', 1, 1, 0),
(22, 5, 'IND', 'Individualized Instruction', 'The instructor provides instruction to individuals or groups and not the entire class. This often occurs while the instructor is roaming the classroom, but students or small groups may also approach the instructor. This code is usually co-coded with SGW or DW. It is important to recognize that this code should not be used to classify the types of student-teacher interactions that are occurring in a large class setting - instead, use this code only when students are engaged in SGW or DW and the instructor is directly interacting with one or more students.', 9, 1, 0),
(23, 1, 'MM', 'Multimedia', 'The instructor plays a video or movie (e.g., Youtube or documentary) for the students to watch.', 8, 1, 0),
(24, 5, 'HUM', 'Humor', 'The instructor tells jokes or humorous anecdotes; this code requires laughter from at least a couple of students.', 5, 1, 0),
(25, 5, 'ANEX', 'Anecdote / Example', 'The instructor gives examples (either verbally through illustrative stories or graphically through movies or pictures) that clearly and explicitly link course material to (a) popular culture, the news, and other common student experiences, or (b) widely recognized cases or incidents that illustrate the abstract (both types are co-coded with CNL).', 6, 1, 0),
(26, 5, 'ORG', 'Organization', 'The instructor writes or posts an outline of class (i.e., advance organizer) or clearly indicates a transition from one topic to the next verbally or through transitional slides. This transition from one topic to another can indicate a change in topics within a single class or from a previous class to the present class. These transitions must be verbally explicit statements to the class (e.g., "Now we''re moving from meiosis to mitosis") as opposed to ambiguous statements such as "Now we''ll pick up where we left off on Monday." This may also include statements concerning how concepts covered in different portions of the class (e.g., lecture, homework and lab) may overlap.', 7, 1, 0),
(27, 5, 'EMP', 'Emphasis', 'The instructor clearly states that something is important for students to learn or remember either for a test, for their future careers, or to just learn the material well.', 8, 1, 0),
(32, 6, 'PI', 'Peer Interactions', 'Students speaking to one another (often during SGW, WCD, or SP).', 1, 1, 0),
(33, 5, 'W', 'Writing', 'This code refers to the instructor actively writing on a digital tablet on top of pre-made visuals.', 2, 1, 0),
(34, 7, 'CB', 'Chalkboard / Whiteboard', NULL, 1, 1, 0),
(35, 7, 'DP', 'Digital Projector', 'The instructor is using the projection of the computer screen as reference, or pointing to, during the lecture.', 2, 1, 0),
(36, 7, 'PP', 'PowerPoint', NULL, 3, 1, 0),
(38, -1, 'D', 'Demonstration Equipment', 'These could include chemistry demonstrations of reactions, physics demonstrations of motion, or any other material being used for the demonstration of a process or phenomenon. The objects must be in active use in relation to the topic. This can also include objects such as rocks being passed around a classroom.', 0, 0, 0),
(39, 7, 'DT', 'Digital Display', 'This refers to any technology where the instructor can actively write on a document or graphic that is being projected onto a screen. This includes document cameras as well as software on a laptop that allows for writing on PDF files.', 6, 1, 0),
(40, 7, 'M', 'Multimedia', 'The instructor plays a video or movie (e.g., YouTube or documentary) while the instructor is talking over a video, movie, or simulation', 4, 1, 0),
(41, -1, 'SI', 'Simulation', 'Simulations can be digital applets or web-based applications.', 0, 0, 0),
(42, 7, 'WEB', 'Website', 'Includes instructor interaction with course website or other online resource (besides Youtube videos). This can include using a website for student responses to questions (in lieu of clickers).', 9, 1, 0),
(43, 6, 'IT', 'Individual Thinking', 'Only Mark when an instructor explicitly asks students to think about a clicker question or another question / problem on their own.', 2, 1, 0),
(44, 6, 'LI', 'Listening', 'Students are listening to the instructor / speaker.', 0, 0, 0),
(45, 5, 'MG', 'Guiding Student Work', 'Instructor moving through class guiding ongoing student work during active learning task.', 10, 1, 0),
(46, 5, 'iID', 'Instructor Idle', 'The instructor is idle when there is an opportunity to be interacting or observing individual students or group activities.', 0, 0, 0),
(47, 5, 'MT', 'Monitoring', 'The instructor is attentive and gauging student work during an active learning task.', 9, 1, 0),
(48, 6, 'TN', 'Taking Notes', 'Students are taking notes', 4, 1, 0);
